import React from 'react'
import './Certifications.css'

class Certifications extends React.Component{
  render(){
    const certList = [
      {
        id: '1',
        title: 'Web Development Path (Node.js)',
        organization: 'Progate'
      },
      {
        id: '2',
        title: 'Online Academy HTML, CSS, JavaScript',
        organization: 'Kementerian Komunikasi dan Informatika'
      },
      {
        id: '3',
        title: 'Introduction to Cyber Security',
        organization: 'Cisco'
      },
    ];
    return(
      <div className="certifications-section">
        <h1 className="title"><span className="sign">&#187;</span>CERTIFICATIONS<span className="sign">&#171;</span></h1>
        <div className="row row-cols-1">
            <div className="col">
                <h2>Web Development Path (Node.js)</h2>
                <h4>Progate</h4>
            </div>
            <div className="col">
                <h2>Introduction to Cyber Security</h2>
                <h4>Cisco Networking Academy</h4>
            </div>
            <div className="col">
                <h2>Online Academy HTML, CSS, JS</h2>
                <h4>Kementerian Komunikasi dan Informatika</h4>
            </div>
        </div>
      </div>
    );
  }
}

export default Certifications;
